import React from 'react';


function AboutPage() {
    return (
        <section className="h-screen w-full bg-gradient-to-b from-magic-300 to-magic-500 flex items-center justify-center gap-36 p-20 ">
            <div className="border-4 rounded-xl h-96 w-72 border-offwhite"></div>
            <div className="h-96 flex flex-col justify-center w-[65%]">
                <div className=" text-center py-1 text-3xl font-bold text-white bg-magic-500 w-56 rounded-full border-2 border-white font-[Poppins]">Sobre</div>
                <div className="text-white text-justify text-lg mt-4 font-[Poppins] flex flex-col gap-4">
                    <p>
                        O estúdio Magic é uma das soluções B2B oferecidas pela Codi Academy, o estúdio é  composto pelos melhores alunos da instituição,  que juntos constroem tecnologia para empresas  parceiras.
                    </p>
                    <p>
                        Já a  Codi Academy é a escola de programação do Centro  Regional de Inovação e Transferência de Tecnologia  (CRITT) da UFJF. Nossa missão é criar novos talentos  para o mercado da Tecnologia.
                    </p>
                </div>
            </div>
        </section>
    );
}

export default AboutPage;
